import "./climb.css"
import React, { useState, useEffect } from 'react';
import { Mountain, MapPin, TrendingUp } from 'lucide-react';

const Climb = () => {
    // State to store climbing routes
    const [climbs, setClimbs] = useState([]);
    const [isLoading, setIsLoading] = useState(true);
    const [error, setError] = useState(null);
  
    // Fetch climbs on component mount
    useEffect(() => {
      const fetchClimbs = async () => {
        try {
          // Replace with your actual API endpoint
          const response = await fetch('/api/climbs');
          
          if (!response.ok) {
            throw new Error('Failed to fetch climbing routes');
          }
          
          const data = await response.json();
          setClimbs(data);
          setIsLoading(false);
        } catch (err) {
          setError(err.message);
          setIsLoading(false);
        }
      };
  
      fetchClimbs();
    }, []);
  
    // Render loading state
    if (isLoading) {
      return (
        <div className="flex justify-center items-center h-screen">
          <div className="animate-spin rounded-full h-32 w-32 border-t-2 border-b-2 border-blue-500"></div>
        </div>
      );
    }
  
    // Render error state
    if (error) {
      return (
        <div className="max-w-md mx-auto mt-10 border rounded-lg border-red-500 overflow-hidden shadow-lg">
          <div className="bg-red-50 p-4">
            <h2 className="text-red-700 font-bold text-xl">Error Fetching Climbs</h2>
          </div>
          <div className="p-4 text-red-600">
            {error}
          </div>
        </div>
      );
    }
  
    return (
      <div className="container mx-auto p-6">
        <div className="bg-white border rounded-lg shadow-md overflow-hidden">
          <div className="px-6 py-4 bg-gray-50 border-b flex items-center space-x-4">
            <Mountain className="h-8 w-8 text-blue-600" />
            <h1 className="text-2xl font-bold text-gray-800">Climbing Routes</h1>
          </div>
          
          {climbs.length === 0 ? (
            <div className="text-center py-6 text-gray-500">
              No climbing routes found
            </div>
          ) : (
            <div className="overflow-x-auto">
              <table className="w-full">
                <thead className="bg-gray-100 border-b">
                  <tr>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Location</th>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Climb</th>
                    <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Grade</th>
                  </tr>
                </thead>
                <tbody className="bg-white divide-y divide-gray-200">
                  {climbs.map((climb) => (
                    <tr key={climb.id} className="hover:bg-gray-50 transition-colors">
                      <td className="px-6 py-4 whitespace-nowrap">
                        <div className="flex items-center space-x-2">
                          <MapPin className="h-4 w-4 text-gray-500" />
                          <span>{climb.location}</span>
                        </div>
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap">
                        <div className="flex items-center space-x-2">
                          <TrendingUp className="h-4 w-4 text-green-500" />
                          <span>{climb.climb}</span>
                        </div>
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap">
                        <span className={`
                          px-2 py-1 rounded-full text-xs font-medium
                          ${climb.grade.startsWith('5.14') ? 'bg-red-100 text-red-800' : 
                            climb.grade.startsWith('5.13') ? 'bg-orange-100 text-orange-800' : 
                            climb.grade.startsWith('5.12') ? 'bg-yellow-100 text-yellow-800' : 
                            'bg-green-100 text-green-800'}
                        `}>
                          {climb.grade}
                        </span>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          )}
        </div>
      </div>
    );
  };

export default Climb;
